import React from 'react';

function Header(props) {
    return (
        <header className="Header">
            <h1 className="Header-Header">Matched Betting Tools</h1>
            <button className="Header-Nav-Btn" onClick={props.handleNavigation}>&#9776;</button>
        </header>
    );
};

export default Header;
